import React from 'react';
import Content from './components/Content';
import logo from './assets/logo.png'; // ✅ 내부 이미지
import './App.css';

function App() {
  return (
    <div className="App">
      <h1 style={{ textAlign: 'center', marginTop: '30px' }}>공주의 콘텐츠 카드들</h1>

      <Content
        image={logo}
        title="첫 번째 콘텐츠"
        description="이건 공주가 만든 첫 번째 콘텐츠입니다. logo.png를 사용했어요!"
      />

      <Content
        image={logo}  // ✅ 두 번째도 같은 이미지 사용
        title="두 번째 콘텐츠"
        description="두 번째도 동일한 logo.png 이미지예요!"
      />
    </div>
  );
}

export default App;
